import './App.css';
import './component/ToDoComponent';
import ToDoRowItem from './component/ToDoComponent';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const data = [
    {
      rowNumber: 1,
      rowDes: 'Feed Bubby',
      rowAss: 'User One'
    },
    {
      rowNumber: 2,
      rowDes: 'Water Plant',
      rowAss: 'User Two'
    },
    {
      rowNumber: 1,
      rowDes: 'Lovely Cat',
      rowAss: 'User Three'
    }
  ];

  return (
    <div className="mt-5 container">
      <div className="card">
        <div className="card-header">
          Your Todo's
        </div>
        <div className="card-body">
          <table className="table table-hover">
            <thead>
              <th scope='col'>#</th>
              <th scope='col'>Description</th>
              <th scope='col'>Assigned</th>
            </thead>
            <tbody>
              <ToDoRowItem rowNumber={data[0].rowNumber} rowDes={data[0].rowDes} />
              <ToDoRowItem />
              <ToDoRowItem />
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default App;
